query:
mutation sitesRemoveSecondaryAwsVSocket ( $socketId:ID! $accountId:ID! ) {
	sites ( accountId:$accountId ) {
		removeSecondaryAwsVSocket ( socketId:$socketId  )  {
			secondaryAwsVSocketRemoveSecondaryAwsVSocketPayload: secondaryAwsVSocket {
				site  {
					id
					name
				}

				id 
				ipAddress 
				subnet 
				routeTableId 
			}
		}

	}	
}
